#commitment {
  background: #163b58;

  .container {
    height: 380px;
  }

  .container_text_commitment {
    display: flex;
    flex-direction: column;
    justify-content: space-evenly;
    height: 100%;
    align-items: center;
  }

  h1 {
    font-family: $font-proximanova;
    font-style: normal;
    font-weight: bold;
    font-size: 18px;
    line-height: 18px;
    text-align: center;
    letter-spacing: 10.5px;
    text-transform: uppercase;
    color: #ffffff;
    width: 262px;

    @media (min-width: 992px) {
      font-size: 24px;
      line-height: 24px;
      width: 596px;
    }
  }

  p {
    font-family: $font-proximanova;
    font-style: normal;
    font-weight: 600;
    font-size: 16px;
    line-height: 117%;
    text-align: center;
    color: #ffffff;

    @media (min-width: 992px) {
      width: 800px;
      font-size: 20px;
    }
  }

  .btn-commit {
    border: 2px solid #f4ba47;
    width: 262px;
    height: 64px;
    display: flex;
    justify-content: center;
    align-items: center;

    font-family: $font-georgia;
    font-style: normal;
    font-weight: bold;
    font-size: 18px;
    line-height: 20px;
    color: #f5f5f5;
    margin-bottom: 1rem;
    cursor: pointer;
  }

  ///modal custom
  .modal {
    display: none;
  }

  .text-modal {
    margin-bottom: 38px;

    @media (max-width: 600px) {
      margin-bottom: 28px;
    }

    p {
      width: 423px;
      font-family: $font-proximanova;
      font-style: normal;
      font-weight: bold;
      font-size: 16px;
      line-height: 24px;
      text-align: center;
      color: #747474;

      @media (max-width: 600px) {
        width: 300px;
        font-size: 12px;
      }
    }
  }

  .modal-container {
    width: 543px;
    height: 531px;

    top: 16%;
    position: absolute;
    left: 0;
    right: 0;

    @media (max-width: 600px) {
      width: 350px;
    }
  }

  .modal-content {
    display: flex;
    flex-direction: column;
    justify-content: center;
    align-items: center;
    position: relative;
  }

  .modal-close {
    position: absolute;
    pointer-events: none;
    top: 0;
    right: 0;
    transform: translateY(-29px);
    cursor: pointer;
    pointer-events: visible;
    img {
      width: 82%;
    }
  }

  .box-logo {
    margin: 50px 0 38px;

    @media (max-width: 600px) {
      margin: 42px 0 34px;
    }
  }

  .container-logo {
    width: 100%;
    height: 100%;

    .logo_modal {
      object-fit: contain;
      object-position: center;
    }
  }

  .submit-form {
    width: 90%;

    form {
      display: flex;
      flex-direction: column;
      justify-content: center;

      input {
        &[type='text'],
        &[type='email'] {
          background: #ededed;
          width: 100%;
          height: 66px;
          font-family: $font-proximanova;
          font-style: normal;
          font-weight: 500;
          font-size: 16px;
          line-height: 24px;
          color: #8a8a8a;
          margin-bottom: 16px;
          padding-left: 32px;
          appearance: none !important;
          -moz-appearance: none !important;
          -webkit-appearance: none !important;

          &::placeholder {
            color: #8a8a8a;
          }
        }
      }

      input {
        &[type='submit'] {
          background: #163b58;
          height: 66px;
          font-family: $font-proximanova;
          font-style: normal;
          font-weight: 500;
          font-size: 16px;
          line-height: 24px;
          color: #ffffff;
          cursor: pointer;
        }
      }
    }
  }

  .animated {
    -webkit-animation-duration: 1s;
    animation-duration: 1s;
    -webkit-animation-fill-mode: both;
    animation-fill-mode: both;
  }

  .animated.faster {
    -webkit-animation-duration: 500ms;
    animation-duration: 500ms;
  }

  .fadeIn {
    -webkit-animation-name: fadeIn;
    animation-name: fadeIn;
  }

  .fadeOut {
    -webkit-animation-name: fadeOut;
    animation-name: fadeOut;
  }

  @keyframes fadeIn {
    from {
      opacity: 0;
    }

    to {
      opacity: 1;
    }
  }

  @keyframes fadeOut {
    from {
      opacity: 1;
    }

    to {
      opacity: 0;
    }
  }
}

